DROP PROCEDURE IF EXISTS `completeEtreAmi`$$
CREATE DEFINER=`DSLT`@`%` PROCEDURE `completeEtreAmi` ()  begin
    declare id1,id2 int(5);
    declare fini int default false;
    declare manquants cursor for
      select idUt, idUt1 from ETREAMI
      where (idUt1, idUt) not in (
        select * from ETREAMI);
    declare continue handler for not found set fini = true;
    open manquants;
    while not fini do
      fetch manquants into id1, id2;
      if not fini then
        insert into ETREAMI values (id2,id1);
      end if;
    end while;
    close manquants;
  end$$

DROP PROCEDURE IF EXISTS `listerActif`$$
CREATE DEFINER=`DSLT`@`%` PROCEDURE `listerActif` ()  BEGIN
    	DECLARE fini int DEFAULT false;
        DECLARE val VARCHAR(1);
        DECLARE pseudo VARCHAR(15);
        DECLARE id int;
        DECLARE nbID int;
        DECLARE cpt int DEFAULT 0;
        DECLARE liste CURSOR FOR
        	SELECT idUt, pseudoUt, activeUt
            FROM UTILISATEUR;
        DECLARE CONTINUE HANDLER FOR NOT FOUND SET fini = true;
        OPEN liste;
        SELECT COUNT(idUt) INTO nbID
        FROM UTILISATEUR;
        WHILE NOT fini DO
        	IF NOT FINI THEN
            	SET cpt = cpt + 1;
            	FETCH liste INTO id, pseudo, val;
                IF val = "t" AND cpt <= nbID THEN
                	INSERT INTO lsActif VALUES(id, pseudo);
             	END IF;
             END IF;
        END WHILE;
    	CLOSE liste;
    END$$

DROP PROCEDURE IF EXISTS `supprimerAmis`$$
CREATE DEFINER=`DSLT`@`%` PROCEDURE `supprimerAmis` (`idUtilisateur` INT, `idAmis` INT)  BEGIN
	DELETE FROM ETREAMI WHERE idUt = idUtilisateur AND idUt1 = idAmis;
    DELETE FROM ETREAMI WHERE idUt1 = idUtilisateur AND idUt = idAmis;
END$$

