DROP FUNCTION IF EXISTS `estActif`$$
CREATE DEFINER=`DSLT`@`%` FUNCTION `estActif` (`pseudo` VARCHAR(15)) RETURNS VARCHAR(100) CHARSET utf8mb4 BEGIN
    	DECLARE res VARCHAR(100);
        DECLARE val VARCHAR(1);
        
        SELECT activeUt into val
        FROM UTILISATEUR
        WHERE pseudoUt = pseudo;
        
        IF val = "t" THEN
        	SET res = "Active";
        END IF;
        IF val = "f" THEN
        	SET res = "Innactive";
        END IF;
        
        RETURN res;
    END$$

DROP FUNCTION IF EXISTS `nbAmi`$$
CREATE DEFINER=`DSLT`@`%` FUNCTION `nbAmi` (`pseudo` VARCHAR(15)) RETURNS INT(11) BEGIN
    	DECLARE res INT;
        DECLARE id INT;
        
        SELECT idUt INTO id
        FROM UTILISATEUR
        WHERE pseudoUt = pseudo;
        
        SELECT COUNT(idUt) INTO res
        FROM ETREAMI
        WHERE idUt = id;
        
        RETURN res;
    END$$

DROP FUNCTION IF EXISTS `nbMessageNonLu`$$
CREATE DEFINER=`DSLT`@`%` FUNCTION `nbMessageNonLu` (`pseudo` VARCHAR(15)) RETURNS INT(11) BEGIN
    	DECLARE res int DEFAULT 0;
        DECLARE val VARCHAR(1);
        DECLARE fini int DEFAULT false;
        DECLARE cpt int DEFAULT 0;
        DECLARE nbMessage int;
        DECLARE liste CURSOR FOR
        	SELECT luMsg
            FROM MESSAGE NATURAL JOIN UTILISATEUR
            WHERE pseudoUt = pseudo;
        DECLARE CONTINUE HANDLER FOR NOT FOUND SET fini = true;
        
        SELECT COUNT(idMsg) INTO nbMessage
        FROM MESSAGE NATURAL JOIN UTILISATEUR
        WHERE pseudoUt = pseudo;
        
        OPEN liste;
        WHILE not fini DO
        	IF NOT fini THEN
            	SET cpt = cpt + 1;
            	FETCH liste INTO val;
            	IF val = "f" AND cpt<=nbMessage THEN
                	SET res = res + 1;
                END IF;
            END IF;
        END WHILE;
        CLOSE liste;
        RETURN res;
    END$$

